import { useState, useEffect } from 'react';
import Navbar from './ui/Navbar';
import Hero from './ui/Hero';
import Services from './ui/Services';
import FeaturedProperties from './ui/FeaturedProperties';
import About from './ui/About';
import Agents from './ui/Agents';
import Testimonials from './ui/Testimonials';
import FAQSection from './ui/FAQ';
import Contact from './ui/Contact';
import Footer from './ui/Footer';

const Index = () => {
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <div className="min-h-screen">
      <Navbar isScrolled={isScrolled} />

      <main>
        <section id="home">
          <Hero />
        </section>

        <section id="services" className="pt-24 lg:pt-32">
          <Services />
        </section>

        <section id="properties" className="pt-24 lg:pt-32">
          <FeaturedProperties />
        </section>

        <section id="about" className="pt-24 lg:pt-32">
          <About />
        </section>

        <section id="agents" className="pt-24 lg:pt-32">
          <Agents />
        </section>

        <section id="testimonials" className="py-24 lg:py-32">
          <Testimonials />
        </section>

        <section id="faq" className="py-24 lg:py-32 bg-zinc-50">
          <FAQSection />
        </section>

        <section id="contact" className="relative">
          <Contact />
        </section>
      </main>

      <Footer />
    </div>
  );
};

export default Index;

export interface Property {
  id: string;
  name: string;
  location: string;
  price: string;
  beds: number;
  baths: number;
  sqft: string;
  tag: 'For Sale' | 'For Rent' | 'Investment';
  image: string;
}

export interface Agent {
  id: string;
  name: string;
  role: string;
  image: string;
}

export interface Testimonial {
  id: string;
  text: string;
  author: string;
  role: string;
  rating: number;
  image: string;
}

export interface FAQ {
  id: string;
  question: string;
  answer: string;
}

import React from 'react';
import { NAV_LINKS } from '../Constants';
import { Compass, ArrowUpRight } from 'lucide-react';

interface NavbarProps {
  isScrolled: boolean;
}

const Navbar: React.FC<NavbarProps> = ({ isScrolled }) => {
  return (
    <nav className={`fixed top-0 left-0 right-0 z-50 transition-all duration-300 ${
      isScrolled ? 'bg-white/90 backdrop-blur-md shadow-sm py-4' : 'bg-transparent py-6'
    }`}>
      <div className="max-w-7xl mx-auto px-6 flex items-center justify-between">
        <div className="flex items-center gap-2 cursor-pointer">
          <div className="p-2 bg-black rounded-lg">
            <Compass className="w-6 h-6 text-white" />
          </div>
          <span className={`text-xl font-bold tracking-tight ${isScrolled ? 'text-zinc-900' : 'text-white md:text-zinc-900'}`}>
            LUMINA LUXE
          </span>
        </div>

        <div className="hidden md:flex items-center gap-8">
          {NAV_LINKS.map((link) => (
            <a
              key={link.name}
              href={link.href}
              className={`text-sm font-medium hover:text-black transition-colors ${
                isScrolled ? 'text-zinc-600' : 'text-zinc-600'
              }`}
            >
              {link.name}
            </a>
          ))}
        </div>

        <button className="bg-black text-white px-5 py-2.5 rounded-full text-sm font-medium flex items-center gap-2 hover:bg-zinc-800 transition-all group">
          Contact Now
          <div className="w-5 h-5 bg-white/20 rounded-full flex items-center justify-center group-hover:bg-white/30 transition-colors">
            <ArrowUpRight className="w-3 h-3" />
          </div>
        </button>
      </div>
    </nav>
  );
};

export default Navbar;

import React, { useState } from 'react';
import { SERVICES, SERVICE_GRID } from '../Constants';
import { ArrowLeft, ArrowRight } from 'lucide-react';

const Services: React.FC = () => {
  const [activeService, setActiveService] = useState(0);

  return (
    <div className="max-w-7xl mx-auto px-6">
      <div className="mb-16">
        <span className="bg-zinc-100 text-zinc-600 px-4 py-1.5 rounded-full text-xs font-semibold tracking-wider uppercase mb-6 inline-block">
          What We Offer
        </span>
        <h2 className="text-4xl md:text-5xl font-bold mb-6 tracking-tight max-w-2xl">
          ELEVATED REAL ESTATE ADVISORY
        </h2>
        <p className="text-zinc-500 max-w-lg leading-relaxed">
          From residential acquisitions to large-scale portfolio management, we provide data-driven solutions tailored for the discerning investor.
        </p>
      </div>

      {/* Service Featured Accordion/Tabs */}
      <div className="grid grid-cols-1 lg:grid-cols-12 gap-12 items-center mb-32">
        <div className="lg:col-span-7 relative">
          <div className="aspect-[4/3] rounded-[2.5rem] overflow-hidden group">
            <img 
              src={SERVICES[activeService].image} 
              alt={SERVICES[activeService].title}
              className="w-full h-full object-cover transition-transform duration-700 group-hover:scale-110"
            />
            <div className="absolute bottom-10 right-10 bg-white p-6 rounded-3xl shadow-2xl flex items-center gap-6">
               <span className="text-5xl font-light text-zinc-300">{SERVICES[activeService].id}</span>
               <p className="font-bold text-lg text-zinc-900">{SERVICES[activeService].title}</p>
            </div>
          </div>
        </div>

        <div className="lg:col-span-5 flex flex-col gap-6">
          <div className="bg-white border border-zinc-100 p-8 rounded-[2rem] shadow-sm relative overflow-hidden group">
            <div className="mb-6 p-3 bg-zinc-50 w-fit rounded-xl">
              {SERVICES[activeService].icon}
            </div>
            <h3 className="text-2xl font-bold mb-4">{SERVICES[activeService].title}</h3>
            <p className="text-zinc-500 leading-relaxed mb-8">
              {SERVICES[activeService].description}
            </p>
            <div className="flex gap-4">
              <button 
                onClick={() => setActiveService((prev) => (prev > 0 ? prev - 1 : SERVICES.length - 1))}
                className="w-12 h-12 rounded-full border border-zinc-200 flex items-center justify-center hover:bg-black hover:text-white transition-all"
              >
                <ArrowLeft className="w-5 h-5" />
              </button>
              <button 
                onClick={() => setActiveService((prev) => (prev < SERVICES.length - 1 ? prev + 1 : 0))}
                className="w-12 h-12 rounded-full border border-zinc-200 flex items-center justify-center hover:bg-black hover:text-white transition-all"
              >
                <ArrowRight className="w-5 h-5" />
              </button>
            </div>
          </div>

          <div className="flex flex-col gap-4">
            {SERVICES.map((s, idx) => (
              <button
                key={s.id}
                onClick={() => setActiveService(idx)}
                className={`flex items-center justify-between p-6 rounded-2xl border transition-all ${
                  activeService === idx ? 'bg-black text-white border-black' : 'bg-transparent text-zinc-400 border-zinc-100 hover:border-zinc-300'
                }`}
              >
                <span className="font-bold uppercase tracking-widest text-sm">{s.id} {s.title}</span>
                <ArrowRight className={`w-4 h-4 transition-transform ${activeService === idx ? 'rotate-[-45deg]' : ''}`} />
              </button>
            ))}
          </div>
        </div>
      </div>

      {/* Service Grid */}
      <div className="text-center mb-16">
        <span className="bg-zinc-100 text-zinc-600 px-4 py-1.5 rounded-full text-xs font-semibold tracking-wider uppercase mb-6 inline-block">
          Why Choose Us
        </span>
        <h2 className="text-4xl md:text-5xl font-bold tracking-tight">
          A SUITE OF EXPERT SERVICES
        </h2>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mb-32">
        {SERVICE_GRID.map((item, idx) => (
          <div key={idx} className="p-8 bg-zinc-50 rounded-[2rem] hover:bg-white hover:shadow-xl transition-all border border-transparent hover:border-zinc-100 group">
            <div className="w-12 h-12 bg-white rounded-xl flex items-center justify-center mb-6 shadow-sm group-hover:bg-black group-hover:text-white transition-colors">
              {item.icon}
            </div>
            <h4 className="text-xl font-bold mb-3">{item.title}</h4>
            <p className="text-zinc-500 leading-relaxed text-sm">
              {item.desc}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Services;

import React from 'react';
import { AGENTS } from '../Constants';
import { Linkedin, Twitter, ArrowRight } from 'lucide-react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './agents-carousel.css';

const Agents: React.FC = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: false,
    arrows: true,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
        }
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        }
      }
    ]
  };
  return (
    <div className="max-w-7xl mx-auto px-6 overflow-hidden">
      <div className="text-center mb-16">
        <span className="bg-zinc-100 text-zinc-600 px-4 py-1.5 rounded-full text-xs font-semibold tracking-wider uppercase mb-6 inline-block">
          Meet Our Experts
        </span>
        <h2 className="text-4xl md:text-5xl font-bold tracking-tight">
          PERSONALIZED GUIDANCE, PROVEN EXPERTISE
        </h2>
      </div>

      <div className="relative">
        <Slider {...settings}>
          {AGENTS.map((agent) => (
            <div key={agent.id} className="px-4">
              <div className="group">
                <div className="relative aspect-[3/4] rounded-[2.5rem] overflow-hidden mb-6">
                  <img 
                    src={agent.image} 
                    alt={agent.name}
                    className="w-full h-full object-cover grayscale group-hover:grayscale-0 transition-all duration-500"
                  />
                  <div className="absolute bottom-6 left-6 flex gap-3 opacity-0 group-hover:opacity-100 transition-opacity translate-y-4 group-hover:translate-y-0 duration-300">
                    <button className="w-10 h-10 rounded-full bg-white flex items-center justify-center hover:bg-black hover:text-white transition-all">
                      <Linkedin className="w-4 h-4" />
                    </button>
                    <button className="w-10 h-10 rounded-full bg-white flex items-center justify-center hover:bg-black hover:text-white transition-all">
                      <Twitter className="w-4 h-4" />
                    </button>
                  </div>
                </div>
                <h4 className="text-xl font-bold mb-1">{agent.name}</h4>
                <p className="text-zinc-400 text-sm font-medium">{agent.role}</p>
              </div>
            </div>
          ))}
        </Slider>
      </div>

      <div className="flex justify-center mt-8">
        <button className="text-sm font-bold flex items-center gap-2 group border-b border-black pb-1">
          Join Our Network
          <ArrowRight className="w-4 h-4 group-hover:translate-x-1 transition-transform" />
        </button>
      </div>
    </div>
  );
};

export default Agents;

